import "./add-cell.css";
import { useActions } from "../hooks/use-actions";
import { Button } from "semantic-ui-react";

interface AddCellProps {
	nextCellId: string | null;
}

const AddCell = ({ nextCellId }: AddCellProps) => {
	const { insertCellBefore } = useActions();

	return (
		<div>
			<Button className="add-cell-button" icon="add" onClick={() => insertCellBefore(nextCellId, "code")}>
				Code
			</Button>
			<Button className="add-cell-button" icon="add" onClick={() => insertCellBefore(nextCellId, "text")}>
				Text
			</Button>
		</div>
	);
};

export default AddCell;
